class Solution:
    def groupAnagrams(self, strs: List[str]) -> List[List[str]]:
        d = {}
        for s in strs:
            if s not in d:
                d[s] = []
            d[s].append(s)
        res = [list(d.values())]

        while len(res) > 0:
            new_res = []

            for r in res:
                for i in range(len(r)):
                    c = list(set(r[i]))
                    for j in range(i+1, len(r)):
                        if set(r[j]).issubset(c):
                            c.remove(r[j])
                            break
                    else:
                        continue

                    if c not in new_res:
                        new_res.append(c)

            res = new_res

        return res
